description:
Soviet Topographic maps

The size of the archive is 90 GB with 75000 files.

This are Soviet Military Topographic Maps downloaded from server. &lt;a href=&quot;
http://poehali.net/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://poehali.net/&lt;/a&gt; . The production date of most maps is from 1960 to
1989. This are very detailed maps, especially for USSR, the Far and Near East.
In many countries this are the only detailed openly available maps.

In the torrent you will find coverage.html , this map shows the approximate
coverage of each map sheet. You have to decompress the ZIP archives so that links in the coverage.html are correct.

A 1958 map symbol guide is available in soviet.pdf .

The map scales are

